// SPDX-License-Identifier: MIT
pragma solidity ^0.7.0;

import "./ERC721TradableMultiple.sol";

/**
 * @title SparkNft
 * SparkNft - a NFT type contract for Slovenian NFT cards.
 */
contract SparkNft is ERC721TradableMultiple {
  constructor(
    string memory _name,
    string memory _symbol,
    uint256 maxSupply_,
    address proxyRegistryAddress_
  ) ERC721TradableMultiple(_name, _symbol, maxSupply_, proxyRegistryAddress_) {
    _setContractURI("https://gateway.pinata.cloud/ipfs/");
    _setBaseURI("https://gateway.pinata.cloud/ipfs/");
  }

  /**
   * @dev Function to change proxyRegistryAddress
   */
  function setProxyRegistryAddress(address proxyRegistryAddress_)
    public
    onlyOwner
  {
    _setProxyRegistryAddress(proxyRegistryAddress_);
  }

  /**
   * @dev Set the base URI for all token IDs. It is
   * automatically added as a prefix to the value returned in {tokenURI},
   * or to the token ID if {tokenURI} is empty.
   */
  function setBaseURI(string memory baseURI_) public onlyOwner {
    _setBaseURI(baseURI_);
  }

  /**
   * @dev Set smart contract uri for info.
   */
  function setContractURI(string memory contractURI_) public onlyOwner {
    _setContractURI(contractURI_);
  }

  function pause() public onlyOwner {
    _pause();
  }

  function unpause() public onlyOwner {
    _unpause();
  }
}

